import axios from "axios";

const AIRCRAFT_API_BASE_URL = "http://localhost:8090/api/v1/";

class AircraftServices {
    getAllAircraft() {
        return axios.get(AIRCRAFT_API_BASE_URL + "aircrafts");
    }
}

export default new AircraftServices();
